const messages = $json.data.getChatMessages.docs
    .filter(msg => {
        const isBroadcast = msg.type === "broadcast";
        const isPayloadArray = Array.isArray(msg.payload?.text);
        const isDirectionIn = msg.direction === "in";
        const isActivateUser = msg.meta?.title === "Activate user" && msg.meta?.activateUser === true;
        const isEmptyText = !msg.payload?.text || (typeof msg.payload.text === "string" && msg.payload.text.trim() === "");

        return !(isBroadcast && (isPayloadArray && isDirectionIn || (isActivateUser && isEmptyText)));
    })
    .flatMap(msg => {
        let role = "customer";
        let textMessage = msg.payload?.text ?? null;
        let fileName = null;
        let messageURL = null;
        let username = null;
        let user_id = null;
        let buttons = [];

        // Definir role, username e user_id conforme o tipo e dire√ß√£o da mensagem
        if (msg.type === "system") {
            role = "system";
        } else if (msg.direction === "out") {
            if (msg.meta?.agent) {
                role = "agent";
                username = msg.meta.agent?.name;
                user_id = msg.meta.agent?._id;
            } else {
                role = "bot";
            }
        } else if (msg.direction === "in" && msg.meta?.customer) {
            role = "customer";
            username = msg.meta.customer?.name;
            user_id = msg.meta.customer?._id;
        }

        // Definir role como "bot" para mensagens broadcast com direction: in
        if (msg.type === "broadcast" && msg.direction === "in") {
            role = "bot";
        }

        // Atendimento transferido
        if (msg.type === "system" && msg.direction === "info" && msg.payload?.type === "CHAT_TRANSFERED") {
            const { agent, department, protocol, observations } = msg.payload;
            const transferredBy = msg.meta?.agent?.name ? `O atendente ${msg.meta.agent.name} realizou uma transfer√™ncia` : `O atendimento foi transferido`;

            if (agent && department) {
                textMessage = `${transferredBy} para ${agent} - ${department} - protocolo ${protocol}`;
            } else if (agent) {
                textMessage = `${transferredBy} para ${agent} - protocolo ${protocol}`;
            } else if (department) {
                textMessage = `${transferredBy} para o departamento ${department} - protocolo ${protocol}`;
            }

            // Adicionar observa√ß√µes, se existirem
            if (textMessage && observations) {
                textMessage = `${textMessage} - Obs.: ${observations}`;
            }
        }

        // Final de chat (Protocolo encerrado)
        if (msg.type === "system" && msg.direction === "info" && msg.payload?.type === "FINISH_CHAT") {
            const agentName = msg.meta?.agent?.name || 'Desconhecido';
            textMessage = `Protocolo ${msg.payload.protocol} encerrado por ${agentName}`;
        }

        // Aplicar a regra para postback
        if (msg.type === "postback" && msg.direction === "in" && !msg.payload?.text && msg.meta?.title) {
            textMessage = msg.meta.title;
        }

        // Aplicar a regra para listas
        if (msg.type === "list" && msg.direction === "out" && msg.payload?.text && Array.isArray(msg.payload?.sections) && msg.payload.sections[0]?.buttons) {
            const sectionsLabels = msg.payload.sections[0].buttons
                .map(button => button.label)
                .join(', ');
            textMessage = `${textMessage} (Op√ß√µes: ${sectionsLabels})`;
        }

        // Criar um array para armazenar as mensagens geradas
        const messagesArray = [];

        // Se houver um texto na mensagem original, adiciona uma entrada com apenas o texto
        if (textMessage) {
            // Verificar se existem bot√µes e, caso haja, adicionar ao texto da mensagem
            if (Array.isArray(msg.payload?.buttons) && msg.payload.buttons.length > 0) {
                const buttonLabels = msg.payload.buttons.map(button => button.label).join(', ');
                textMessage = `${textMessage} (Op√ß√µes: ${buttonLabels})`;
            }

            messagesArray.push({
                data: { ...msg },
                username,  
                user_id,
                role,
                textMessage,
                fileName: null,
                messageURL: null,
                createdAt: msg.createdAt,
                type: "text"
            });
        }

        // Se houver um arquivo, adiciona uma nova entrada separada
        if (msg.type === "file" && msg.payload?.name && msg.payload?.url) {
            messagesArray.push({
                data: { ...msg },
                username,  
                user_id,
                role,
                textMessage: null,
                fileName: msg.payload.name,
                messageURL: msg.payload.url,
                createdAt: msg.createdAt,
                type: msg.type
            });
        }

        // Se houver um √°udio, adiciona uma nova entrada separada
        if (msg.type === "audio" && msg.payload?.url) {
            messagesArray.push({
                data: { ...msg },
                username,  
                user_id,
                role,
                textMessage: null,
                fileName: null,
                messageURL: msg.payload.url,
                createdAt: msg.createdAt,
                type: msg.type
            });
        }

        return messagesArray;
    })
    .sort((a, b) => new Date(a.createdAt) - new Date(b.createdAt));

return [{ messages }];
